def generate_sequence(n, m=None):
    """"""
    if n <= 0:
        return []
    sequence = [0, 1]
    for i in range(2, n):
        if m is not None:
            sequence.append((sequence[i - 1] + sequence[i - 2]) % m)
        else:
            sequence.append(sequence[i - 1] + sequence[i - 2])
    return sequence
